#Esta funcion auxiliar hace operaciones de strings

def operacion_strings(a,b,operacion):
  if operacion == '+':
    return a+b
  elif operacion == '-':
    return a-b
  elif operacion == '*':
    return a*b
  elif operacion == '/':
    return a//b
  elif operacion == '^':
    return a**b

